import React, { Component } from 'react';
import WebsiteLayout from '../../components/wrapper/mainSite';

export default class letsMove extends Component {
	render() {
		return (
			<WebsiteLayout>
				<div>lets-move</div>
			</WebsiteLayout>
		);
	}
}
